Alameda del Tajo 공원 절벽에서 바라보는 경치를 만끽하시고 투우장쪽으로 길따라 지나 누에보다리를 겸치구경 후 Iglesia de Santa María la Mayor 성당으로 가서 내부구경하신 후 상당 뒤 골목길 투어를 하시면 누에보 다리 지나 투우장 맞은편 쇼핑거리와 카페,레스토랑 거리로 도보투어 하시는 걸 추천 합니다.
늦은 오후에 도착하시면 Alameda del Tajo에서 바라 보는 아름다운 일몰을 볼수 있습니다.

그리고, 론다에서 말라가 가는 길중에서 해안가 도로 말고 산악지역으로 가는 길이 있는데 넓은 초원 지역이 나옵니다.
눈이 호강합니다.
